import SearchComponent from './components/SearchComponent';
import Keycloak from 'keycloak-js';
import { useEffect } from 'react';

const keycloakConfig = {
    url: "http://localhost:8181/",
    realm: "Gestion-Documentos",
    clientId: "react-app-client",
};

function App(){
    const [keycloak, setKeycloak] = useState(null);
    useEffect(() => {
        const iniKeycloak = async () => {
            const keycloakInstance = new Keycloak(keycloakOptions);
            try{
                await keycloakInstance.init({ onLoad: 'login-required' });
                setKeycloak(keycloakInstance);
                if(keycloakInstance.authenticated){
                    console.log(keycloakInstance);
                }
            } catch (error){
                console.error('Error ${error}');
            }
        }
        iniKeycloak();
    }, [])
    const handleLogout = () => {
        if(keycloak){
            keycloak.logout();
        }
    }

    return (
        <div>
        <nav className="navbar navbar-expand-lg navbar-dark bg-primary">  
        <div className="container-fluid">  
            <a className="navbar-brand" href="#">React App</a>  
            <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav">  
            <span className="navbar-toggler-icon"></span>  
            </button>  
            <div className="collapse navbar-collapse" id="navbarNav">  
            <ul className="navbar-nav ms-auto">  
                {keycloak && keycloak.authenticated ? (  
                <li className="nav-item">  
                    <button className="btn btn-danger" onClick={handleLogout}>Cerrar sesi√≥n</button>  
                </li>  
                ) : null}  
            </ul>  
            </div>  
        </div>  
        </nav>  

        <div className="container-fluid">  
            <h2 className="text-center">React Search</h2>  
            <SearchComponent />  
        </div>
    </div>
    );
}

const keycloak = new Keycloak(keycloakConfig);

export default keycloak;
